import React from 'react';
import './GradingPage.css';

function GradingPage() {
  return (
    <div className="grading-page">
      <div className="grading-header">
        <h1>考试结果</h1>
      </div>

      <div className="grading-content">
        <div className="loading-dots">
          <span></span>
          <span></span>
          <span></span>
        </div>

        <h2 className="grading-title">考试结束，阅卷中</h2>

        <div className="illustration">
          <svg width="300" height="300" viewBox="0 0 300 300" fill="none" xmlns="http://www.w3.org/2000/svg">
            {/* 椅子背景 */}
            <ellipse cx="150" cy="260" rx="120" ry="15" fill="#E8E8F0" opacity="0.6"/>

            {/* 椅子 */}
            <rect x="70" y="200" width="160" height="80" rx="10" fill="#E8E8F0"/>
            <rect x="80" y="190" width="140" height="20" rx="10" fill="#D1D1E0"/>

            {/* 笔记本电脑 */}
            <rect x="90" y="170" width="120" height="80" rx="5" fill="#C8C8D8" transform="rotate(-10 150 210)"/>
            <rect x="95" y="175" width="110" height="60" rx="3" fill="#FFFFFF" transform="rotate(-10 150 205)"/>

            {/* 人物身体 */}
            <ellipse cx="150" cy="160" rx="35" ry="45" fill="#FFB6B6"/>

            {/* 衣服 */}
            <path d="M 120 160 Q 150 140 180 160 L 180 210 Q 150 220 120 210 Z" fill="#FF9999"/>

            {/* 手臂 */}
            <ellipse cx="110" cy="180" rx="12" ry="35" fill="#FF9999" transform="rotate(-30 110 180)"/>
            <ellipse cx="190" cy="180" rx="12" ry="35" fill="#FF9999" transform="rotate(30 190 180)"/>

            {/* 手 */}
            <ellipse cx="100" cy="200" rx="10" ry="12" fill="#FFB6B6"/>
            <ellipse cx="200" cy="200" rx="10" ry="12" fill="#FFB6B6"/>

            {/* 裤子 */}
            <ellipse cx="135" cy="220" rx="20" ry="40" fill="#9E9EB0"/>
            <ellipse cx="165" cy="220" rx="20" ry="40" fill="#9E9EB0"/>

            {/* 头 */}
            <circle cx="150" cy="120" r="30" fill="#FFB6B6"/>

            {/* 头发 */}
            <path d="M 130 110 Q 150 90 170 110 L 170 125 Q 150 105 130 125 Z" fill="#8B7355"/>

            {/* 眼睛 */}
            <circle cx="142" cy="120" r="3" fill="#333333"/>
            <circle cx="158" cy="120" r="3" fill="#333333"/>

            {/* 嘴巴 */}
            <path d="M 145 130 Q 150 133 155 130" stroke="#333333" strokeWidth="2" fill="none"/>

            {/* 背包 */}
            <rect x="165" y="140" width="30" height="40" rx="5" fill="#FF9999"/>
            <rect x="170" y="145" width="20" height="10" fill="#FF7777"/>
          </svg>
        </div>

        <div className="time-info">
          <span>考试用时：</span>
          <span className="time">0分钟</span>
        </div>

        <div className="waiting-text">
          闭卷中，请耐心等待
        </div>
      </div>
    </div>
  );
}

export default GradingPage;
